public boolean hasCriteriaChangedSinceTrace()
{
    if (lastInventTrackingDimTracingCriteria.parmItemIdCriteria() != inventTrackingDimTracingCriteria.parmItemIdCriteria()
        || !InventDim::isInventDimEqual(inventTrackingDimTracingCriteria.parmInventDimCriteria(), lastInventTrackingDimTracingCriteria.parmInventDimCriteria()))
    {
        return true;
    }
    return false;
}

void init()
{
    inventTrackingDimTracingCriteria = InventTrackingDimTracingCriteria::newFromArgs(element.args());
    controlOriginalCaptions = new Map(Types::String, Types::String);

    // Clear the record so that we don't get kernel-generated form caption.
    element.args().record(null);

    super();

    originalCaption = element.design().caption() + inventTrackingDimTracingCriteria.getCallerBufferCaption();
    element.design().caption(originalCaption);

    lastInventTrackingDimTracingCriteria = InventTrackingDimTracingCriteria::newFromPacked(inventTrackingDimTracingCriteria.pack());

    if (!hasMenuItemAccess(menuitemDisplayStr(InventBatch), MenuItemType::Display))
    {
        inventoryBatchTabPage.visible(false);
    }

    isQMSEnabled = InventParameters::find().UseQualityManagement;

    if (!isQMSEnabled || !hasMenuItemAccess(menuitemDisplayStr(InventNonConformanceTable), MenuItemType::Display))
    {
        nonConformancesTabPage.visible(false);
    }

    if (!isQMSEnabled || !hasMenuItemAccess(menuitemDisplayStr(InventQualityOrderTable), MenuItemType::Display))
    {
        qualityOrderTabPage.visible(false);
        qualityActionPaneGroup.visible(false);
    }

    if (includeWarehouseSpecificInventoryTransactions)
    {
        GeneralStorageDimension.visible(false);
        GeneralStorageDimensionPopulateAtRuntime.visible(true);

        GeneralTrackingDimensions.visible(false);
        GeneralTrackingDimensionsPopulateAtRuntime.visible(true);

        GeneralProductDimensions.visible(false);
        GeneralProductDimensionsPopulateAtRuntime.visible(true);

        OnHandInventoryUnit.visible(false);
        OnHandInventoryUnitPopulateAtRuntime.visible(true);

        OnHandCWUnit.visible(false);
        OnHandCWUnitPopulateAtRuntime.visible(true);

        InventTrans_PdsCWQty.visible(false);
        Transaction_PdsCWQtyPopulateAtRuntime.visible(true);

        InventTrans_DateInvent.visible(false);
        Transaction_DateInventPopulateAtRuntime.visible(true);            

        InventTrans_Qty.visible(false);
        Transaction_QtyPopulateAtRuntime.visible(true);

        OnHandInventSerialId.visible(false);
        OnHandInventSerialIdPopulateAtRuntime.visible(true);

        OnHandInventBatchId.visible(false);
        OnHandInventBatchIdPopulateAtRuntime.visible(true);                                    
    }        

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

/// <summary>
///    Returns to the Dimensions display framework the inventDimSetupObject that should be used depending
///    on which Dimensions display button was selected (for quality orders or for nonconformances).
/// </summary>
/// <returns>Inventory dimension setup</returns>
public Object inventDimSetupObject()
{
    str nameOfSelectedControl = this.selectedControl().name();

    switch (nameOfSelectedControl)
    {
        case nonconformances_InventDimParmFixed.name():
            return inventDimFormSetupNonConformance;

        case quality_InventDimParmFixed.name():
            return inventDimFormSetupQualityOrder;

        case productionOrderInventDimParmFixed.name():
            return inventDimFormSetupProductionOrder;
    }
    return null;
}

