/// <summary>
///    Start a new trace in the current form with criteria from the current tree node.
/// </summary>
/// <param name="_newInventTrackingDimTracingCriteria">
///    The criteria from the current node.
/// </param>
public void newTraceInCurrentForm(InventTrackingDimTracingCriteria _newInventTrackingDimTracingCriteria)
{
    // Replace current criteria with the new criteria.
    inventTrackingDimTracingCriteria.unpack(_newInventTrackingDimTracingCriteria.pack());

    // Do the trace based on current node
    element.onTraceClicked();
}

/// <summary>
/// This method is invoked by the trace dialog and returns to the caller form (if it exists) if the trace was cancelled and there was no previous trace.
/// </summary>
public void onCancelTrace()
{
    if (noTraceExists && element.args().caller())
    {
        element.close();
    }
}

/// <summary>
/// This method is invoked by the trace dialog.
/// </summary>
public void onTraceClicked()
{
    if (!inventTrackingDimTracingCriteria.validate())
    {
        return;
    }

    lastInventTrackingDimTracingCriteria = InventTrackingDimTracingCriteria::newFromPacked(inventTrackingDimTracingCriteria.pack());
    InventTrackingDimTracingRelations inventTrackingDimTracingRelations = InventTrackingDimTracingSearch::searchNoPack(inventTrackingDimTracingCriteria);
    boolean lastTracingResults = inventTrackingDimTracingRelations != null;

    exportButton.enabled(lastTracingResults);
    buttonShowAllBatch.enabled(lastTracingResults);
    buttonShowAllTransactions.enabled(lastTracingResults);
    inventBatchButtonGroupShow.enabled(lastTracingResults);
    salesActionPaneGroup.enabled(lastTracingResults);
    purchActionPaneGroup.enabled(lastTracingResults);
    buttonShowAllProduction.enabled(lastTracingResults);
    qualityActionPaneGroup.enabled(lastTracingResults);
    printButtonGroup.enabled(lastTracingResults);

    buttonShowPendingTransactions.enabled(true);
    buttonShowPendingProduction.enabled(true);

    noTraceExists = false;

    this.updateTitle();
    this.redrawTree(lastTracingResults, inventTrackingDimTracingRelations);
}

