public void redrawTree(boolean _tracingResult, InventTrackingDimTracingRelations _inventTrackingDimTracingRelations)
{
    InventTrackingDimTracingHierarchy inventTrackingDimTracingHierarchy = InventTrackingDimTracingHierarchy::newFromTracingResults(_inventTrackingDimTracingRelations);

    inventTrackingDimTracingHierarchy.parmTraceDirection(inventTrackingDimTracingCriteria.parmTraceDirection());

    // Delete all existing nodes
    tree.deleteAll();

    // Initialize class for handling the tree control.
    inventTrackingDimTracingHierarchyTree = InventTrackingDimTracingHierarchyTree::newFromForm(tree,
            alreadyTracedComboBoxCtrl, goToAlreadyTracedButton, returnFromGoToAlreadyTracedButton, inventTrackingDimTracingHierarchy);

    // Initialize class for handling information shown for each tree node
    inventTrackingDimTracingFormCtrl = InventTrackingDimTracingFormCtrl::newFromForm(element, inventTrackingDimTracingHierarchyTree, inventTrackingDimTracingCriteria);
    inventTrackingDimTracingFormCtrl.parmOpenReferenceCtrl(openReferenceButton);
    inventTrackingDimTracingFormCtrl.parmNewTraceMenuButton(newTraceMenuButton);
    inventTrackingDimTracingFormCtrl.parmOnHandMenuButton(inventOnHandItemAction);
    inventTrackingDimTracingFormCtrl.parmPickingListMenuButton(prodJournalPickingListLineSummary);

    if (includeWarehouseSpecificInventoryTransactions)
    {
        inventTrackingDimTracingFormCtrl.parmInventTrackingDimTracingFormElements(this.buildTracingFormElements());
    }

    // These buttons are not enabled for the top tree node.
    openReferenceButton.enabled(false);
    newTraceMenuButton.enabled(false);
    prodJournalPickingListLineSummary.enabled(false);

    inventTrackingDimTracingFormCtrl.initFromFormrun();

    if (_tracingResult)
    {
        inventTrackingDimTracingHierarchyTree.createTopTreeNode(inventTrackingDimTracingCriteria);
        inventTrackingDimTracingHierarchyTree.buildTree();
        inventTrackingDimTracingHierarchyTree.setFocusOnTopTreeNode();
    }
}

public void run()
{
    super();

    if (element.args() && element.args().parmObject() is InventTrackingDimTracingCriteria)
    {
        // Called from another tracing form. Do the trace based on the specified criteria.
        element.onTraceClicked();
    }
    else
    {
        element.showTraceCriteria();
    }
}

