/// <summary>
///    Modifies form controls according to dimensions display settings.
/// </summary>
/// <param name="mode">
///    The mode the method is called with. For this form, only Init makes sense. If this form is modified, please add the other modes.
/// </param>
private void updateDesign(InventDimFormDesignUpdate mode)
{
    Set             dataSourcesSet;
    InventDimParm   inventDimParm;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetupNonConformance)
            {
                InventDimControlIdCollection inventDimControlIdCollection = InventDimControlIdCollection::construct();
                inventDimControlIdCollection.add(NonConformancesInventoryDimensionsGrid.id(), true);
                inventDimFormSetupNonConformance = InventDimCtrl::newFromFormValidDataSource(element, inventDimNonConformanceTable_ds.name(), inventDimControlIdCollection) as InventDimCtrl_Frm;
            }
            if (!inventDimFormSetupQualityOrder)
            {
                InventDimControlIdCollection inventDimControlIdCollection = InventDimControlIdCollection::construct();
                inventDimControlIdCollection.add(QualityOrderInventoryDimensions.id(), true);
                inventDimFormSetupQualityOrder = InventDimCtrl::newFromFormValidDataSource(element, inventDimQualityOrderTable_ds.name(), inventDimControlIdCollection) as InventDimCtrl_Frm;
            }
            if (!inventDimFormSetupProductionOrder)
            {
                InventDimControlIdCollection inventDimControlIdCollection = InventDimControlIdCollection::construct();
                inventDimControlIdCollection.add(PmfProdCoByInventoryDimensions.id(), true);
                inventDimControlIdCollection.add(ProdJournalProdInventoryDimensions.id(), true);

                dataSourcesSet = new Set(Types::String);
                dataSourcesSet.add(inventDimPmfProdCoBy_ds.name());
                dataSourcesSet.add(inventDimProdJournalProd_ds.name());
                inventDimFormSetupProductionOrder = InventDimCtrl::newFromFormValidDataSources(element, dataSourcesSet, inventDimControlIdCollection) as InventDimCtrl_Frm;

                inventDimParm.clear();
                inventDimParm.InventSiteIdFlag = NoYes::Yes;
                inventDimFormSetupProductionOrder.parmDimParmLockedRightClick(inventDimParm.data());
            }
            inventDimFormSetupNonConformance.formSetControls(true,true);
            inventDimFormSetupQualityOrder.formSetControls(true,true);
            inventDimFormSetupProductionOrder.formSetControls(true,true);

            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

