public void updateProductionFastTabControls(boolean _init = false)
{
    if (_init)
    {
        controlOriginalCaptions.insert(prodTable_BOMRoute.name(), prodTable_BOMRoute.caption());
        controlOriginalCaptions.insert(prodTable_BOMRoute_BOMDate.name(), prodTable_BOMRoute_BOMDate.label());
        controlOriginalCaptions.insert(prodTable_BOMRoute_BOMId.name(), prodTable_BOMRoute_BOMId.label());
        controlOriginalCaptions.insert(prodTable_BOMRoute_BOMId.name(), prodTable_BOMRoute_BOMId.label());
        controlOriginalCaptions.insert(prodBOM.name(), prodBOM.caption());
    }
    else
    {
        if (prodTable.ProdType == ProdType::Process)
        {
            prodTable_BOMRoute.caption("@PRO119");
            prodTable_BOMRoute_BOMDate.label("@PRO94");
            prodTable_BOMRoute_BOMId.label("@PRO101");
            prodBOM.caption("@PRO1115");
            productionOrderCoProductsGroup.visible(true);
        }
        else
        {
            prodTable_BOMRoute.caption(controlOriginalCaptions.lookup(prodTable_BOMRoute.name()));
            prodTable_BOMRoute_BOMDate.label(controlOriginalCaptions.lookup(prodTable_BOMRoute_BOMDate.name()));
            prodTable_BOMRoute_BOMId.label(controlOriginalCaptions.lookup(prodTable_BOMRoute_BOMId.name()));
            prodBOM.caption(controlOriginalCaptions.lookup(prodBOM.name()));
            productionOrderCoProductsGroup.visible(false);
        }
    }
}

