public void init()
{
    super();

    // For the top node case which will have InventTransId empty
    inventQualityOrderTable_ds.queryBuildDataSource()
        .addRange(fieldNum(InventQualityOrderTable, InventRefTransId)).value(SysQuery::valueNotEmptyString());

    // Replace the default joining relation on InventTransId with a relation on InventRefTransId
    inventQualityOrderTable_ds.queryBuildDataSource().clearDynalinks();

    inventQualityOrderTable_ds.queryBuildDataSource()
        .addDynalink(
            fieldNum(InventQualityOrderTable, InventRefTransId),
            inventTransOrigin,
            fieldNum(InventTransOrigin, InventTransId));
}

