public void init()
{
    super();

    // For the top node case which will have InventTransId empty
    inventNonConformanceTable_ds.queryBuildDataSource()
        .addRange(fieldNum(InventNonConformanceTable, InventTransIdRef)).value(SysQuery::valueNotEmptyString());

    // Add dynalinks
    inventNonConformanceTable_ds.queryBuildDataSource().clearDynalinks();

    inventNonConformanceTable_ds.queryBuildDataSource()
        .addDynalink(
