public void init()
{
    QueryBuildDataSource    qbds;
    str                     queryValue;

    super();

    qbds = prodJournalProd_ds.queryBuildDataSource();
    if (#PdsCatchWeightEnabled)
    {
        queryValue = strFmt('((%1 != 0) || (%2 != 0) || (%3 != 0) || (%4 != 0))',
                            fieldStr(ProdJournalProd, QtyGood),
                            fieldStr(ProdJournalProd, PdsCWBatchGood),
                            fieldStr(ProdJournalProd, QtyError),
                            fieldStr(ProdJournalProd, PdsCWBatchErr));
    }
    else
    {
        queryValue = strFmt('((%1 != 0) || (%2 != 0))',
                            fieldStr(ProdJournalProd, QtyGood),
                            fieldStr(ProdJournalProd, QtyError));
    }

    qbds.addRange(fieldNum(ProdJournalProd, QtyGood)).value(queryValue);
}

