    {
        InventTransFormHelper::jumpRefReferenceId(inventTransOrigin);
    }
    else if (inventTrackingTransaction && includeWarehouseSpecificInventoryTransactions)
    {              
        InventTransOrigin localInventTrans;
        localInventTrans.ReferenceCategory = inventTrackingTransaction.referencecategory();                    
        localInventTrans.ReferenceId = inventTrackingTransaction.referenceId();               

        InventTransFormHelper::jumpRefReferenceId(localInventTrans);
    }
}

