    return ret;
}

public void selectionChanged(FormTreeItem _oldItem, FormTreeItem _newItem, FormTreeSelect _how)
{
    super(_oldItem, _newItem, _how);

    inventTrackingDimTracingFormCtrl.onTreeNodeChange(_newItem.idx());

    inventTrackingTransaction = inventTrackingDimTracingFormCtrl.getInventTrackingTransaction();
}

public void jumpRef()
{
    str value = GeneralStorageDimension_wMSLocationIdPopulateAtRuntime.text();
    Args            args = new Args();

    if (value)
    {
        args.record(WMSLocation::find(value, GeneralStorageDimension_InventLocationIdPopulateAtRuntime.text()));
    }

    MenuFunction menuFunction = new MenuFunction(menuitemDisplayStr(WHSLocation), MenuItemType::Display);           
    menuFunction.run(args);
}

